css:
/* i really want this to be global */
body {
    background: #151515;
    color: rgb(240, 240, 240);
}
#bd {
    background: rgba(0, 0, 0, 0);
    color: rgb(240, 240, 240);
}
a {
    color: rgb(255, 255, 255);
}
.sidebar {
    background: rgb(30, 30, 30);
}
.sidebar a {
    color: rgb(219, 219, 219);
    display: block;
}
.main-container {
    background: rgba(0, 0, 0, 0);
    color: rgb(255, 255, 255);
}

.apidocs .item .name .namespace {
    color: #dedede;
}
.apidocs .item .name a {
    color: #aaa;
}

.prefix {
    color: #eee;
}

.apidocs .args {
    display: inline;
    color: #e6e6e6;
}
.apidocs .args span {
    color: #938fff;
}
.apidocs .flag {
    background: #333;
    border-radius: 0;
    color: #ddd;
    font-size: 11px;
    margin: 0 0.5em;
    padding: 3px 6px 3px;
}
.apidocs .meta {
    border: 0;
    color: #8c8c8c;
    font-size: 14px;
    padding: 6px 0;
}

.box p {
    color: #bdbdbd;
}
/* Text blocks */
.box code,
.apidocs .params .param-name,
.apidocs .params .param-description p code,
.apidocs .description p code,
.apidocs .returns .returns-description p code,
.apidocs #properties p code,
.apidocs .description ul li code,
.apidocs .description pre,
.apidocs .description pre code span,
.apidocs #events p code {
    background: #393939;
    border-color: rgba(113, 113, 113, 0);
    color: #e1e1e1;
}
/* Made by ZpeedTube */
.apidocs .description pre .typ {
    color: #b1b2ff;
}
.apidocs .params .type a {
    color: #db5157;
}

.apidocs .events code {
    color: #ccc;
}
/* Light gray text */
.apidocs .events p,
.apidocs #events p,
.apidocs #method_create p,
.apidocs .description p,
.apidocs .description ul li,
.apidocs .returns .returns-description .type a {
    color: #ccc;
}
/* Gray text */
.apidocs .returns .returns-description p {
    color: #aaa;
}
